//Home page Component

//Module import
import React, { Component } from 'react';
import { M } from 'materialize-css';

//Style import
import './Home.css';
import 'materialize-css/dist/css/materialize.min.css';

class Home extends Component {
	constructor(props) {
		super(props);

		this.state = {};
	}

	render() {
		return (
			<div>
				<Carousel
					images={[
						'../../../public/img/pizza1.jpg',
						'../../../public/img/pizza2.jpg',
						'../../../public/img/pizza3.jpg',
						'../../../public/img/pizza4.jpg',
						'../../../public/img/pizza5.jpg'
					]}
					options={{
						fullWidth: true,
						indicators: true
					}}
				/>
			</div>
		);
	}
}

export default Home;
